import React, {useState, useEffect} from 'react';
import axios from "axios";

const MovieGame = () => {
    const [listGame, setListGame] = useState(null);
  useEffect(() => {
    axios.get("https://wild-games.herokuapp.com/api/v1").then((response) => {
      console.log(response.data.map((item) => item.genres));
      setListGame(response.data.map((item) => item.genres));
    });
  }, []);
  return listGame !== null ? (
    <div className="App">
      {listGame.map((item) => {
        return (
          <div>
            <p>{item[0].name}</p>
            <img src={item[0].image_background} alt="picture" />
          </div>
        );
      })}
    </div>
  ) : (
    <p>Pas de data</p>
  );
};

export default MovieGame;
